import React, {useState} from 'react';
import 'css/App.css';

function App() {
    const [likes, setLikes] = useState(0);

    function increment() {
        setLikes(likes + 1);
    }

    function decrement() {
        setLikes(likes - 1);
    }

    return (
        <div className="App">
            <p>Likes: { likes }</p>
            <button onClick={increment}>Like</button>
            <button onClick={decrement}>Dislike</button>
        </div>
    );
}

export default App;
